import { Link } from "react-router-dom";
import { Fragment } from "react";
import styles from "./styles.module.scss";
import ClosetCard from "./card";

const Closets = ({closets}) => {
    return(
        <Fragment>
            {closets.map(c => (
                <ClosetCard closet={c}/>

            ))
            }
        </Fragment>
    );
};

export default Closets;
